const Register = () => {
    return (
        <div>
            <form>
                <label>Username:</label>
                <input className='formInput' type='text' value={username}></input>
                <br></br>
                <label>Password:</label>
                <input className='formInput' type='text' value={password}></input>
                <br></br>
                <input type='submit'></input>
            </form>
        </div>
    )
}

export default Register;
